(29, 'هرمزگان', '[\"\\u062a\\u0627\\u0628\\u0644\\u0648\",\"\\u0628\\u0647\\u062a\\u0631\\u06cc\\u0646 \\u0633\\u0627\\u06cc\\u062a \\u0645\\u0639\\u0631\\u0641\\u06cc \\u0644\\u0648\\u0627\\u0632\\u0645 \\u062f\\u0631 \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u062a\\u0628\\u0644\\u06cc\\u063a\\u0627\\u062a \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc \\u0647\\u0627\\u06cc \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc\\u0647\\u0627\\u06cc \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc \\u0628\\u0646\\u062f\\u0631\\u0639\\u0628\\u0627\\u0633\",\"\\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc \\u0647\\u0627\\u06cc \\u0628\\u0646\\u062f\\u0631\\u0639\\u0628\\u0627\\u0633\",\"\\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc\\u0647\\u0627\\u06cc \\u0628\\u0646\\u062f\\u0631\\u0639\\u0628\\u0627\\u0633\",\"\\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc \\u0634\\u0647\\u0631\\u0647\\u0627\\u06cc \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u062a\\u0628\\u0644\\u06cc\\u063a\\u0627\\u062a \\u0648 \\u0646\\u06cc\\u0627\\u0632\\u0645\\u0646\\u062f\\u06cc \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u062e\\u0631\\u06cc\\u062f \\u0648 \\u0641\\u0631\\u0648\\u0634 \\u062f\\u0631 \\u0627\\u0633\\u062a\\u0627\\u0646 \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u062e\\u0631\\u06cc\\u062f \\u0648 \\u0641\\u0631\\u0648\\u0634 \\u0644\\u0648\\u0627\\u0632\\u0645 \\u062f\\u0633\\u062a \\u0648 \\u062f\\u0648\\u0645 \\u062f\\u0631 \\u0647\\u0631\\u0645\\u0632\\u06af\\u0627\\u0646\",\"\\u062e\\u0631\\u06cc\\u062f \\u0648 \\u0641\\u0631\\u0648\\u0634 \\u0644\\u0648\\u0627\\u0632\\u0645 \\u062f\\u0633\\u062a \\u062f\\